const MowingHours = ({ handleChange, buttonClick }) => {
  return (
    <>
      <span>
        <label id="mowingHours">How many hours do you mow per day?</label>
      </span>
      <span>
        <ul className="buttons">
          <li>
            <button
              name="mowingHours"
              value="3"
              onClick={(e) => {
                buttonClick(e);
                handleChange(e);
              }}
            >
              &#60;4
            </button>
          </li>
          <li>
            <button
              name="mowingHours"
              value="5"
              onClick={(e) => {
                buttonClick(e);
                handleChange(e);
              }}
            >
              4-6
            </button>
          </li>
          <li>
            <button
              className="active"
              name="mowingHours"
              value="7"
              onClick={(e) => {
                buttonClick(e);
                handleChange(e);
              }}
            >
              6-8
            </button>
          </li>
          <li>
            <button
              name="mowingHours"
              value="9"
              onClick={(e) => {
                buttonClick(e);
                handleChange(e);
              }}
            >
              8+
            </button>
          </li>
        </ul>
      </span>
    </>
  );
};

export default MowingHours;
